import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './HomePage';
import AddRecipePage from './AddRecipePage';
import ShoppingListPage from './ShoppingListPage';
import FavoritesPage from './FavoritesPage';
import ProfilePage from './ProfilePage';
import LoginPage from './LoginPage';
import RegistrationPage from './RegistrationPage';
import ChatbotPage from './ChatbotPage';
import RecipeDetailPage from './RecipeDetailPage';
import Navbar from './Navbar';
import Footer from './Footer';
import BreakfastPage from './BreakfastPage';
import LunchPage from './LunchPage'; // New
import DinnerPage from './DinnerPage'; // New
import PastaPage from './PastaPage'; // New
import SoupsPage from './SoupsPage'; // New
import DessertsPage from './DessertsPage'; // New
import axios from 'axios';

const appStyles = {
  app: {
    textAlign: 'center',
  },
};

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  useEffect(() => {
    axios
      .get('http://localhost:5001/session', { withCredentials: true })
      .then((response) => {
        if (response.data.message === 'Session valid') {
          setIsLoggedIn(true);
        } else {
          setIsLoggedIn(false);
        }
      })
      .catch(() => {
        setIsLoggedIn(false);
      });
  }, []);

  return (
    <Router>
      <div style={appStyles.app}>
        {/* Navbar */}
        <Navbar isLoggedIn={isLoggedIn} setIsLoggedIn={setIsLoggedIn} />

        {/* Routes */}
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/breakfast" element={<BreakfastPage />} />
          <Route path="/lunch" element={<LunchPage />} />
          <Route path="/dinner" element={<DinnerPage />} />
          <Route path="/pasta" element={<PastaPage />} />
          <Route path="/soups" element={<SoupsPage />} />
          <Route path="/desserts" element={<DessertsPage />} />
          <Route path="/add-recipe" element={<AddRecipePage />} />
          <Route
            path="/shopping-list"
            element={
              isLoggedIn ? (
                <ShoppingListPage />
              ) : (
                <LoginPage setIsLoggedIn={setIsLoggedIn} />
              )
            }
          />
          <Route
            path="/favorites"
            element={
              isLoggedIn ? (
                <FavoritesPage />
              ) : (
                <LoginPage setIsLoggedIn={setIsLoggedIn} />
              )
            }
          />
          <Route
            path="/profile"
            element={
              isLoggedIn ? (
                <ProfilePage />
              ) : (
                <LoginPage setIsLoggedIn={setIsLoggedIn} />
              )
            }
          />
          <Route
            path="/login"
            element={<LoginPage setIsLoggedIn={setIsLoggedIn} />}
          />
          <Route path="/register" element={<RegistrationPage />} />
          <Route
            path="/chatbot"
            element={
              isLoggedIn ? (
                <ChatbotPage />
              ) : (
                <LoginPage setIsLoggedIn={setIsLoggedIn} />
              )
            }
          />
          <Route path="/recipe-detail" element={<RecipeDetailPage />} />
        </Routes>

        {/* Footer */}
        <Footer />
      </div>
    </Router>
  );
}

export default App;
